import React, { useState } from 'react';
import { Upload, X } from 'lucide-react';

export default function QuoteUploader({ vendorId, onUpload }) {
  const [quote, setQuote] = useState({
    title: '',
    amount: '',
    validUntil: '',
    file: null,
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    if (quote.file) {
      onUpload({
        title: quote.title,
        amount: Number(quote.amount),
        validUntil: new Date(quote.validUntil),
        file: URL.createObjectURL(quote.file),
        vendorId,
      });
    }
  };

  const handleFileChange = (e) => {
    if (e.target.files && e.target.files[0]) {
      setQuote({ ...quote, file: e.target.files[0] });
    }
  };

  return (
    <div className="bg-white p-6 rounded-lg shadow-sm border border-gray-200">
      <h3 className="text-lg font-semibold mb-4">Upload Quote</h3>
      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label className="block text-sm font-medium text-gray-700 mb-1">
            Quote Title
          </label>
          <input
            type="text"
            value={quote.title}
            onChange={(e) => setQuote({ ...quote, title: e.target.value })}
            className="w-full rounded-lg border border-gray-300 px-3 py-2 focus:outline-none focus:ring-1 focus:ring-blue-500"
            placeholder="Enter quote title"
            required
          />
        </div>

        <div className="grid grid-cols-2 gap-4">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Amount
            </label>
            <input
              type="number"
              value={quote.amount}
              onChange={(e) => setQuote({ ...quote, amount: e.target.value })}
              className="w-full rounded-lg border border-gray-300 px-3 py-2 focus:outline-none focus:ring-1 focus:ring-blue-500"
              placeholder="0.00"
              required
              min="0"
              step="0.01"
            />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">
              Valid Until
            </label>
            <input
              type="date"
              value={quote.validUntil}
              onChange={(e) => setQuote({ ...quote, validUntil: e.target.value })}
              className="w-full rounded-lg border border-gray-300 px-3 py-2 focus:outline-none focus:ring-1 focus:ring-blue-500"
              required
              min={new Date().toISOString().split('T')[0]}
            />
          </div>
        </div>

        <div className="border-2 border-dashed border-gray-300 rounded-lg p-6">
          <div className="flex flex-col items-center">
            {!quote.file ? (
              <>
                <Upload className="h-12 w-12 text-gray-400" />
                <p className="mt-2 text-sm text-gray-600">
                  Drag and drop your quote file here, or{' '}
                  <label className="text-blue-600 hover:text-blue-500 cursor-pointer">
                    browse
                    <input
                      type="file"
                      className="hidden"
                      onChange={handleFileChange}
                      accept=".pdf,.doc,.docx,.xls,.xlsx"
                    />
                  </label>
                </p>
                <p className="text-xs text-gray-500 mt-1">
                  PDF, Word, or Excel files up to 10MB
                </p>
              </>
            ) : (
              <div className="flex items-center space-x-2">
                <span className="text-sm text-gray-600">{quote.file.name}</span>
                <button
                  type="button"
                  onClick={() => setQuote({ ...quote, file: null })}
                  className="text-gray-500 hover:text-gray-700"
                >
                  <X className="h-4 w-4" />
                </button>
              </div>
            )}
          </div>
        </div>

        <div className="flex justify-end">
          <button
            type="submit"
            className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
          >
            Upload Quote
          </button>
        </div>
      </form>
    </div>
  );
}
